            </div>
        );
    }
}
class Project extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
            <div>
                <h1>HighLighted Project</h1>
                <div>
                    {PROJECTS.map((PROJECT, id) => {
                        return (
                            <div >
                                <Projects key={PROJECT.id} project={PROJECT} />
                            </div>
                        )
                    })}
                </div>
            </div>
        );
    }
}

export default Project;
